<style scoped lang="scss">
    @import "scss/pages/eliteClub/eliteClub";
</style>
<script>
    import comm from 'static/js/comm.js';
    import Popup from "components/PopupLayer/PopupLayer";
    import clubData from '../clubData/clubData';
    import axios from "axios"
    export default {
        methods:{
            textState(state){
                let str = '';
              switch (parseInt(state,10)) {
                  case 1:
                      str = '';
                      break;
                  case 2:
                      str = '';
                      break;
                  case 3:
                      str = '';
                      break;
                  case 4:
                      str = '';
                      break;
              }
                return str;
            },
            changeMeetingTab(index){
              let t = this;
              t.meetingIndex = index;
            },
            openPersonal(item){
              let t = this;
              //console.log(item.officeCustomerId);
                if(!(typeof appjs == "undefined" || appjs == null || appjs == "")){
                  appjs&&appjs.gotoPersonalCenter($.toJSON({
                      customerId:item.officeCustomerId
                  }));
              }
            },
            formatTime(time){
                if(time&&time.length){
                    let arrStr = time.split(' ');
                    let timeArrStr = arrStr[1].split(':');
                    return arrStr[0]+"&nbsp;&nbsp;&nbsp;&nbsp;"+timeArrStr[0]+":"+timeArrStr[1];
                }else{
                    return '';
                }
            },
            formatSubject(type){
              let t = this;
              let str = '';
              /*Id(: 9999-,2-,7-,9-,10000- : 99999-,823-,832-,844-,849-,851-)*/
              switch (parseInt(type,10)) {
                  case 9999:
                      str = '';
                      break;
                  case 2:
                      str = '';
                      break;
                  case 7:
                      str = '';
                      break;
                  case 9:
                      str = '';
                      break;
                  case 10000:
                      str = '';
                      break;
              }
              return str;
            },
            test(){
                if(!(typeof appjs == "undefined" || appjs == null || appjs == "")) {
                    appjs ? appjs.gotoTerminalDetailVC($.toJSON({
                        "resourceId": '2517493068808476',
                        "resourceType": '1',
                        "tplPath": 'm.allinmd.cn'
                    })) : '';
                }
            },
            formatMeetingTime(str){
                let today = new Date();//
                let year = today.getFullYear();//
                let meetYear = parseInt(str.substring(0,4),10);
                let reg = /\d{2}-\d{2}\s/g;
                if(meetYear<year){
                    return meetYear+'-'+(str.match(reg))[0];
                }else{
                    return (str.match(reg))[0];
                }
            },
            openLive(item){
                let t = this;
                if(!(typeof appjs == "undefined" || appjs == null || appjs == "")){
                    appjs&&appjs.gotoEliteClubBroadcastVC(
                        $.toJSON({
                           /* authority:item.authority,
                            boradcastUserId:item.boradcastUserId,
                            boradcastRoomNum:item.boradcastRoomNum,
                            boradcastAuthcode:item.boradcastAuthcode,
                            boradcastLiveId:item.boradcastLiveId,
                            boradcastRecoderId:item.boradcastRecoderId,
                            broadcastNameString:item.broadcastNameString,
                            broadcastType:item.broadcastType*/
                            columnId:t.columnId,
                            broadcastStartTime:item.liveStartTime,
                            authority:item.authority,
                            liveId:item.liveId,
                            boradcastUserId:item.boradcastUserId,
                            boradcastRoomNum:item.boradcastRoomNum,
                            boradcastAuthcode:item.boradcastAuthcode,
                            boradcastLiveId:item.boradcastLiveId,
                            boradcastRecoderId:item.boradcastRecoderId,
                            broadcastNameString:item.broadcastNameString,
                            broadcastType:item.liveState
                        })
                    );
                    //console.log('');
                }

            },
            jumpIntro(){
              let _this = this;
              window.location.href = 'https://m.allinmd.cn/dist/elite/elite.html#/organization';
            },
            checkGroup(){
                let _this = this;
                window.location.href = 'https://m.allinmd.cn/dist/elite/elite.html#/member';
            },
            openMeeting(item){
                //console.log(item);
                if(!(typeof appjs == "undefined" || appjs == null || appjs == "")){
                    //console.log('');
                    appjs&&appjs.gotoConferenceDetailInfoVC($.toJSON({
                        meetId:item.conId,
                        meetName:item.conName
                    }));
                }
            },
            getMeetingList(){
              let t = this;
                axios.get('/mcall/conference/index/getList/', {
                    params: {
                        paramJson: {
                            subjectTeamId:[2,7,9][t.meetingIndex],
                            firstResult:0,
                            maxResult:1000,
                            sortType:1,
                            columnId:t.columnId,
                            isValid:1,
                            conName:''
                        }
                    }
                })
                    .then(function (res) {
                        if(res&&res.data&&res.data&&res.data.responseData&&res.data.responseData.dataList&&res.data.responseData.dataList.length>0){
                            t.meetingList = res.data.responseData.dataList;
                            console.log(t.meetingList.length)
                        }
                    })
                    .catch(function (error) {
                        console.log(error);
                    });
            },
            getLiveList(){
                let t = this;
                axios({
                    url: '/mcall/cms/column/config/getColumnLiveList/',
                    method: "POST",
                    data: {
                        columnId:t.columnId,
                        sortType:1,
                        isValid:1,
                        showType:1,
                        columnType:3
                    },
                    transformRequest: [function(data) {
                        return "paramJson=" + JSON.stringify(data);
                    }],
                    headers: {
                        'X-Requested-With': 'XMLHttpRequest'
                    },
                    timeout: 30000
                }).then(function(res){
                    if(res&&res.data&&res.data.responseObject&&res.data.responseObject.responseData&&res.data.responseObject.responseData.dataList&&res.data.responseObject.responseData.dataList.length>0){
                        //console.log(res.data.responseObject.responseData.dataList);
                        t.liveList = res.data.responseObject.responseData.dataList;
                    }
                });
            }
        },
        data(){
          return {
              /*popupConfig:{},*/
              meetingList:[],
              meetingIndex:0,
              liveList:[],
              maxLen:2,
              addPopup:1,
              toggleOnOff:false,
              toggleMeetingOnOff:false
          }
        },
        components:{
            /*Popup*/
        },
        mounted(){
          let t = this;
          t.getMeetingList();
          t.getLiveList();
        /*  if(!((typeof  appjs)==='undefined')){
                appjs.updateTitle('');
          }  */
        // //console.log(appjs)
          if(!(typeof appjs == "undefined" || appjs == null || appjs == "")){
                appjs&&appjs.updateTitle('');
          }
        },
        computed:{
            columnId(){
                let t = this;
                return comm.getpara().columnId;
            },
            clubDataInfo(){
                return clubData.clubOffLineCompositionData();
            }
        },
        watch:{
            meetingIndex(){
                let t = this;
                //t.meetingList = [];
                t.getMeetingList();
            }
        }
    }
</script>
